svg.script:
document.addEventListener('DOMContentLoaded', function() {
  // 定义卡片中心点
  const centerX = 380.5;
  const centerY = 319.5;

  // 存储卡片的原始/最终变换矩阵和动画延迟
  const cards = [
    {
      id: "card1",
      rectId: "rect1",
      originalTransform: "matrix(0.8066086173057556, 0.5910858511924744, -0.692837119102478, 0.7210940718650818, 306.24609375, 0)",
      delay: 0
    },
    {
      id: "card2",
      rectId: "rect2",
      originalTransform: "matrix(0.9200168251991272, 0.3918788433074951, -0.48759254813194275, 0.8730711936950684, 200.3486328125, 7.626708984375)",
      delay: 300
    },
    {
      id: "card3",
      rectId: "rect3",
      originalTransform: "matrix(0.9883502125740051, 0.15219618380069733, -0.19791020452976227, 0.9802202582359314, 93.423828125, 73.44781494140625)",
      delay: 600
    },
    {
      id: "card4",
      rectId: "rect4",
      originalTransform: "matrix(0.9981404542922974, 0.06095504388213158, -0.07981448620557785, 0.9968098402023315, 41.4384765625, 115.45330810546875)",
      delay: 900
    }
  ];

  // 初始化卡片
  cards.forEach(card => {
    // 获取卡片元素
    const cardElement = document.getElementById(card.id);
    const rectElement = document.getElementById(card.rectId);

    // 保存原始变换
    card.originalRect = rectElement.getAttribute('transform');

    // 设置初始状态 - 所有卡片堆叠在中心
    cardElement.style.opacity = "1";
  });

  // 设置初始位置 - 所有卡片堆叠在中心
  const initialTransform = "matrix(1, 0, 0, 1, 100, 250)";

  // 执行动画
  setTimeout(() => {
    cards.forEach(card => {
      const cardElement = document.getElementById(card.id);
      const rectElement = document.getElementById(card.rectId);

      // 设置初始位置
      rectElement.setAttribute('transform', initialTransform);

      // 延迟后开始动画
      setTimeout(() => {
      // 创建动画
        rectElement.animate(
          [
            { transform: initialTransform },
            { transform: card.originalTransform }
          ], 
          {
        duration: 1500,
        easing: 'ease-out',
            fill: 'forwards'
          }
        ).onfinish = function() {
          // 动画结束后设置最终位置
          rectElement.setAttribute('transform', card.originalTransform);
        };
      }, card.delay);
    });
  }, 100);
});
